<html lang="en"><head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <meta name="robots" content="noindex">
    <title>GoodRx - Error</title>
    <style>
      * {
        -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
        -webkit-tap-highlight-color: transparent;
        -webkit-box-sizing: border-box;
        -moz-box-sizing: border-box;
        box-sizing: border-box;
      }
      html {
        font-family: "Helvetica Neue", Helvetica, Arial, sans-serif; /* 1 */
        line-height: 1.15; /* 2 */
        -ms-text-size-adjust: 100%; /* 3 */
        -webkit-text-size-adjust: 100%; /* 3 */
      }
      body {
        margin: 0;
        padding: 0;
        background: #f0f3f5;
        height: 100vh;
      }
      h1 {
        font-weight: 400;
        font-size: 24px;
        margin-bottom: 25px;
      }
      p {
        font-size: 18px;
        text-align: left;
        line-height: 1.4;
      }
      header {
        background-color: #ffef64;
        border-bottom: 1px solid #e7d85c;
        box-shadow: 0 2px 5px rgba(0, 0, 0, 0.25);
        padding: 16px 16px 14px;
        position: relative;
        text-align: center;
      }
      .tagline {
        display: none;
        color: #756d2d;
        margin-left: 10px;
        position: relative;
        top: -4px;
        font-size: 17px;
      }
      .error-message {
        background: #fff;
        border-bottom: 1px solid #ced7dc;
        padding: 30px 20px;
        text-align: center;
      }
      .grx-link {
        color: #007aff;
        text-decoration: none;
      }
      @media (min-width: 768px) {
        header {
          padding-left: 48px;
          padding-right: 48px;
          text-align: left;
        }
        .tagline {
          display: inline-block;
        }
        h1 {
          font-size: 32px;
        }
        p {
          font-size: 17px;
        }
        .error-message {
          border-radius: 4px;
          box-shadow: 0 2px 5px rgba(0, 0, 0, 0.25);
          max-width: 640px;
          margin: 48px auto 0;
          padding: 64px 48px;
        }
        .img {
          margin: 20px auto;
        }
      }
    </style>
  </head>
